-- SMIHD-13015 - New Report - Incorrectly Located Pro Shock SKUs

/*
Exception report that shows all the SKUs w/ a KK PGC thad do not have a pick location LIKE 'S%'​(exluding "SHOP")

FIELDS: SKU, Description, Current Pick Location
*/


select * from tblPGC where upper(ixPGC) LIKE '%K%'
and UPPER(sDescription) like '%PRO%'


-- SMIHD-13015
SELECT DISTINCT S.ixPGC 'PGC', S.ixSKU 'SKU',
    ISNULL(S.sWebDescription, S.sDescription) 'SKUDescription',
    SL.sPickingBin 'PickBin'
FROM tblSKU S
    left join tblSKULocation SL on S.ixSKU = SL.ixSKU and ixLocation = 99
WHERE S.ixPGC = 'kK'
    AND S.flgDeletedFromSOP = 0 
    AND S.ixSKU NOT LIKE 'UP%' -- exclude per Larkins       -- 2,892
    -- AND S.dtDiscontinuedDate > getdate()
    AND S.ixSKU NOT IN (-- SKUs w/pick bin starting with S (other than the SHOP bins)
                        SELECT distinct ixSKU--,sPickingBin
                        FROM tblSKULocation
                        WHERE ixLocation = 99
                            and sPickingBin LIKE 'S%'
                            and sPickingBin NOT LIKE 'SHOP%'  -- 2,858
                    ) -- 1,994
ORDER BY SL.sPickingBin




SELECT distinct sPickingBin 
from tblSKULocation
WHERE UPPER(sPickingBin) LIKE '%SHOP%'
    and sPickingBin <> 'SHOP'
     


